import React from "react";
import "./addchannelpopup.css";

export default function AddChannelPopup(){
    return(
        <Popup  handleClose={PopupClose}>
            <h2>Create a public channel</h2>
            <form action="">
                <label htmlFor="channel-name">Name</label>
                <input type="text"/>
                <div className="emoji-picker"></div>
            </form>
        </Popup>    
    );
}
